(50, 1, '2019-02-25 05:44:43', '2019-02-25 02:44:43', '<!-- wp:paragraph -->\n<p>Even the all-powerful Pointing has no control about the blind texts it is an almost unorthographic life One day however a small line of blind text by the name of Lorem Ipsum decided to leave for the far World of Grammar.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Big Oxmox advised her not to do so, because there were thousands of bad Commas, wild Question Marks and devious Semikoli, but the Little Blind Text didn’t listen. She packed her seven versalia, put her initial into the belt and made herself on the way.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When she reached the first hills of the Italic Mountains, she had a last view back on the skyline of her hometown Bookmarksgrove, the headline of Alphabet Village and the subline of her own road, the Line Lane. Pityful a rethoric question ran over her cheek, then she continued her way.</p>\n<!-- /wp:paragraph -->', 'GYM FITNESS', 'Even the all-powerful Pointing has no control about', 'publish', 'open', 'open', '', 'gym-fitness', '', '', '2019-02-25 16:21:40', '2019-02-25 13:21:40', '', 0, 'http://megazine.loc/?p=50', 0, 'post', '', 0),
